import React,{Component} from "react";
export default class Home extends Component{
    render(){
        return(
        <div>
            <h3>Welome to FindMyMovies</h3>
            <p>We, at FindMyMovies believe in making happy moments for people affordable and accessible!!!</p>
            <br/><br/>
            <p>Please check out our Events Page to view the latest events at your place and everything exciting!</p>

        </div>
        );
    }
}
